import React from 'react';
import gallery from './images/gallery.png';
import logo from './images/juried logo-01.svg';
import './App.css';

import './SASS/main.scss';

function App() {
  return (
    <div className='homepage'>
      <div className='aboveFold'>
        <div className='aboveFold_photo'>
          <img className='aboveFold_photo-logo' src={logo} alt='logo' />
          <img className='aboveFold_photo-img' src={gallery} alt='gallery' />
        </div>
        <div className='aboveFold_card'>
          <div className='aboveFold_card_menu'>
            <ul className='aboveFold_card_menu'>
              <li className='aboveFold_card_menu_item'>Home</li>
              <li className='aboveFold_card_menu_item'>About</li>
            </ul>
          </div>
          <p className='aboveFold_card_content'>
            The best art you haven't yet discovered.
          </p>
        </div>
      </div>
    </div>
  );
}

export default App;
